insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_canal','Multi Value List','select distinct case when prof_app_id= 0 then proto_descr else prof_std_desc end codigo_usr,case when prof_app_id= 0 then proto_descr else prof_std_desc end descipcion_usr from m_reg_desc_map as b left join m_meters a on b.meter_id=a.meter_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point left join m_prof_map c on b.app_id=c.prof_app_id where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) and reg_type in (4,6) union all select ''-100'' codigo_usr, ''Todos'' descripcion_usr order by codigo_usr asc;','Canales',0,'         ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_option_medidor','Selector Medidor','-','Seleccionar Medidor o punto de medida',0,'$(""inputname=prm_option_medidor"").click(function(){ $(""#prm_medidor_chosen"").chosen(""destroy"");$(""#prm_punto_medida_chosen"").chosen(""destroy""); if($(""inputname=prm_option_medidor:checked"").val()==1){ $(""#div_prm_medidor"").show(); $(""#prm_punto_medida_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_punto_medida"").hide(); $(""#prm_punto_medida"").val(""""); $(""#prm_medidor_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""});} else {$(""#prm_medidor_chosen option:selected"").removeAttr(""selected"");$(""#div_prm_medidor"").hide(); $(""#prm_medidor"").val(""""); $(""#div_prm_punto_medida"").show(); $(""#prm_punto_medida_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""});}});','');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_fecha_dinamica','Value List','SELECT  id_date, descripcion   from r_dynamic_date','Selector de fecha dinamica',0,'      ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_option_fecha','Selector Fecha','-','Seleccionar Fecha est√°tica o fecha din√°mica',0,'$(""inputname=prm_option_fecha"").click(function(){ if($(""inputname=prm_option_fecha:checked"").val()==1){ $(""#div_prm_desde"").show(); $(""#div_prm_hasta"").show(); $(""#div_prm_fecha_dinamica"").hide(); $(""#prm_fecha_dinamica"").val(""""); } else { $(""#div_prm_desde"").hide(); $(""#div_prm_hasta"").hide(); $(""#prm_desde"").val(""""); $(""#prm_hasta"").val("""");$(""#div_prm_fecha_dinamica"").show(); } $("".wizard"").smartWizard(""fixHeight""); });','');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_medidor_cli','Multi Value List','select distinct a.meter_id codigo,a.meter_id descripcion from m_meters a inner join m_location_meters as d on a.meter_id=d.meter_id inner join m_location as e on d.id_meter_point=e.id_meter_point inner join m_app_protos as h on a.app_proto_id=h.proto_id and h.descr <> ''PRIME ALLIANCE'' where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) union all select ''-100'' codigo,''Todos'' descripcion order by codigo;','Medidores',0,'                    ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_marca','Multi Value List','select distinct b.brand_id,concat(brand,'' '',model,'' '',version) marca from  m_meters_brands b left join m_meters a on a.brand_id=b.brand_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point where a.meter_id <> ''FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'' and case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) order by concat(brand,'' '',model,'' '',version);','Marca-Modelo-Versi√≥n',0,'          ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_proto_fisico','Value List','select distinct b.description codigo,b.description,2 orden from m_phy_protos b left join m_meters a on a.phy_proto_id=b.proto_id left join m_app_protos g on a.app_proto_id=g.proto_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) and b.description <> ''No Protocol'' and descr <> ''PRIME ALLIANCE'' union select ''Todos'' codigo,''Todos'' description, 1 orden order by orden,description;','Protocolo F√≠sico',0,'                ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_proto_app','Value List','select distinct descr codigo,descr,2 orden from m_app_protos b left join m_meters a on a.app_proto_id=b.proto_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) and descr <> ''No Protocol'' and descr <> ''PRIME ALLIANCE'' union select ''Todos'' codigo, ''Todos'' descr, 1 orden  order by orden, descr;','Protocolo APP',0,'              ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_grupo','Value List','select ''Medidor'' cod, ''Medidor'' descripcion  union all  select ''Fecha'' cod, ''Fecha'' descripcion;','Agrupar por',0,'      ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_desc_registro','Multi Value List','select distinct case when prof_app_id= 0 then proto_descr else prof_std_desc end codigo_usr,case when prof_app_id= 0 then proto_descr else prof_std_desc end descipcion_usr from m_reg_desc_map as b left join m_meters a on b.meter_id=a.meter_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point left join m_prof_map c on b.app_id=c.prof_app_id where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) and reg_type in (1) union all select ''-100'' codigo_usr,''Todos'' descripcion_usr order by codigo_usr asc;','Registros',0,'          ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_desc_registro_inst','Multi Value List','select distinct case when prof_app_id= 0 then proto_descr else prof_std_desc end codigo_usr,case when prof_app_id= 0 then proto_descr else prof_std_desc end descipcion_usr from m_reg_desc_map as b left join m_meters a on b.meter_id =a.meter_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point left join m_prof_map c on b.app_id=c.prof_app_id where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) and reg_type in (2,6) union all select ''-100'' codigo_usr,''Todos'' descripcion_usr order by codigo_usr asc;','Registro',0,'          ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_punto_medida_cli','Multi Value List','select distinct case when d.id_meter_point is null then ''-1'' else d.id_meter_point end codigo_p_medida,case when d.id_meter_point is null then ''-1'' else d.id_meter_point end desc_p_medida from m_location as d inner join m_location_meters a	on d.id_meter_point=a.id_meter_point inner join m_meters b on a.meter_id=b.meter_id inner join m_app_protos c on b.app_proto_id=c.proto_id and descr <> ''PRIME ALLIANCE'' where case when d.group_id is null then -1 else d.group_id end in (${prm_grupos}) union all select ''-100'' codigo_p_medida,''Todos'' desc_p_medida order by codigo_p_medida asc;','Punto de Medida',0,'          ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_option_medidor_cli','Selector Medidor','-','Seleccionar Medidor o punto de medida',0,'   $(""inputname=prm_option_medidor_cli"").click(function(){ $(""#prm_medidor_cli_chosen"").chosen(""destroy""); $(""#prm_punto_medida_cli_chosen"").chosen(""destroy""); if($(""inputname=prm_option_medidor_cli:checked"").val()==1){ $(""#div_prm_medidor_cli"").show(); $(""#prm_punto_medida_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_punto_medida_cli"").hide(); $(""#prm_punto_medida_cli"").val(""""); $(""#prm_medidor_cli_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""});} else {$(""#prm_medidor_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_medidor_cli"").hide(); $(""#prm_medidor_cli"").val(""""); $(""#div_prm_punto_medida_cli"").show(); $(""#prm_punto_medida_cli_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""});} });','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_evento','Multi Value List','select distinct case when ev_app_id= 0 then proto_descr else ev_std_desc end codigo_usr,case when ev_app_id= 0 then proto_descr else ev_std_desc end descipcion_usr from m_ev_desc_map as b left join m_meters a on b.meter_id=a.meter_id left join m_location_meters as d on a.meter_id=d.meter_id left join m_location as e on d.id_meter_point=e.id_meter_point left join m_ev_map c on b.app_id=c.ev_app_id where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) union all select ''-100'' codigo_usr, ''Todos'' descripcion_usr order by codigo_usr asc;','Evento',0,'        ','cli');
insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_option_medidor_pmedida_cliente_cli','Radio Button','-','Selector de Medidor, Punto de Medida y Cliente',0,'   $(""inputname=prm_option_medidor_pmedida_cliente_cli"").click(function(){ $(""#prm_medidor_cli_chosen"").chosen(""destroy""); $(""#prm_punto_medida_cli_chosen"").chosen(""destroy""); $(""#prm_cliente_cli_chosen"").chosen(""destroy"");if($(""inputname=prm_option_medidor_pmedida_cliente_cli:checked"").val()==1){ $(""#div_prm_medidor_cli"").show(); $(""#prm_medidor_cli_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""}); $(""#prm_punto_medida_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_punto_medida_cli"").hide(); $(""#prm_punto_medida_cli"").val(""""); $(""#prm_cliente_cli_chosen option:selected"").removeAttr(""selected"");$(""#div_prm_cliente_cli"").hide(); $(""#prm_cliente_cli"").val(""""); } else if($(""inputname=prm_option_medidor_pmedida_cliente_cli:checked"").val()==2){ $(""#prm_medidor_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_medidor_cli"").hide(); $(""#prm_medidor_cli"").val(""""); $(""#prm_cliente_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_cliente_cli"").hide(); $(""#prm_cliente_cli"").val(""""); $(""#div_prm_punto_medida_cli"").show(); $(""#prm_punto_medida_cli_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""Seleccione""}); } else if($(""inputname=prm_option_medidor_pmedida_cliente_cli:checked"").val()==3){$(""#prm_medidor_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_medidor_cli"").hide(); $(""#prm_medidor_cli"").val(""""); $(""#prm_punto_medida_cli_chosen option:selected"").removeAttr(""selected""); $(""#div_prm_punto_medida_cli"").hide(); $(""#prm_punto_medida_cli"").val(""""); $(""#div_prm_cliente_cli"").show(); $(""#prm_cliente_cli_chosen"").chosen({width: ""100%"", placeholder_text_multiple: ""S