insert into r_parameters (PARAMETER, TIPO_COMPONENTE, CONSULTA, DESCR, PAR_REQUIRED, JS, ORI_DB) values ('prm_cliente_cli','Multi Value List','select distinct concat(f.customer_id,''__'',nombre) customer_id,f.nombre from m_location as e inner join c_customers as f on e.customer_id=f.customer_id where case when e.group_id is null then -1 else e.group_id end in (${prm_grupos}) union all select ''-1__Todos'' customer_id,''Todos'' nombre order by customer_id asc;','Clientes',0,'    ','cli');
